import {BrowserRouter as Route,Switch ,Router} from 'react-router-dom'
import './App.css';
import Notes from './pages/Notes';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path='/'>
          <Notes/>
        </Route>
      </Switch>

    </Router>
  );
}

export default App;
